import React from 'react'
import ReactDOM from 'react-dom'




const Header = (props)=> {
  return (  
    <div>
    <h1>
      This is {props.course} course
    </h1>
  </div>  
  )
}

const Content = (props) => {
  console.log(props)
  return(
    <div>
    <p>
      This is {props.name} chapter

    </p>
  </div>  
  )

}

const Total = (props) => {
  return(
    <div>
    <p>
      This get {props.exercises} points
    </p>
  </div>  
  )

}

const Separator =() =>{
  return(
    <div>
    <p>
      -------------------------------------
    </p>
  </div>  
  )
}



const App = () => {
  const course = 'Half Stack application development'

  const parts = [{
    name:  'Fundamentals of React',
    exercises : 10
  },

  {
    name: 'Using props to pass data',
    exercises: 7
  },

  { 
    name: 'State of a component',
    exercises : 14
  }]


  return (
    <div>
    <Header course={course}/>
    <Content name={parts[0].name} />
    <Total exercises={parts[0].exercises} />
    <Content name={parts[1].name} />
    <Total exercises={parts[2].exercises} />
    <Content name={parts[3].name} />
    <Total exercises={parts[3].exercises} />



  </div>
  );
}






ReactDOM.render(<App />, document.getElementById('root'))
